export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for listings to load
    await page.waitForSelector('.listing', { timeout: 10000 });

    // Get all listings with ratings >= 4.8
    const highRatedListings = await page.evaluate(() => {
      const listings = document.querySelectorAll('.listing');
      const results = [];

      listings.forEach(listing => {
        const ratingElement = listing.querySelector('.listing-rating span');
        if (ratingElement) {
          const rating = parseFloat(ratingElement.textContent);
          if (rating >= 4.8) {
            const id = listing.getAttribute('data-listing-id') || listing.id;
            results.push({ id, rating });
          }
        }
      });

      return results;
    });

    // Take screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_results.png'));

    return {
      success: true,
      action: "Extracted high-rated accommodations (rating >= 4.8)",
      extractedData: highRatedListings,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

